      pos: 31.538582,-1.3870115
      parent: 2
    - type: Paper
      content: >-
        A couple engineers came by earlier to finish installing our artifact chamber's gas network, but when I asked for an explanation on how it works one of them just stared at me like I'd asked him to punch me or something. Management must have them working doubles.


        In the end, they just put a t-ray scanner on the front desk and left, so I had to figure it out myself. It doesn't look too complicated... I think.


        - The intake valve by the air alarm seems to put new air into the chamber?

        - The release valve by the window just pumps whatever was in the chamber outside... I guess we'd better install a warning sign out there.

        - The port by the lockers is for putting gas into the chamber, that much is obvious.

        - The gas filter leads to the second port by the vessels and also to a pump that goes outside. Why would you want to pump filtered gas outside, though? Don't you want to save it?


        I'm glad it's finally set up now, at least. Though... every time I look over at the canisters sitting next to the anomaly vessels, it makes me shiver. One of my friends says he knew a guy who left a plasma canister near one of those and had an anomaly go critical, and the whole department wound up needing to be cloned. Maybe we should keep them out front...
